import { StyledMain, Text, StyledButton } from './styles';
import { Container } from '../../assets/globalStyles';
import Lottie from 'react-lottie';

import SwipeDown from '../../../public/swipeDown.json';

function Home() {



  const defaultOptions = {
    loop: true,
    autoplay: true,
    animationData: SwipeDown,
    rendererSettings: {
      preserveAspectRatio: 'xMidYMid slice'
    }

  };



  return (
    <StyledMain>
      <Container>
        <img src="/rick.svg" alt="" />
        <Text>Rick and Morty</Text>
        <StyledButton>SOBRE</StyledButton>
        <Lottie options={defaultOptions} height={400} width={400} />
      </Container>
    </StyledMain>
  );


};

export default Home;
